import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css'
import Home from './pages/Home/Home';

function App() {
  return (
    <div className="App">
      <BrowserRouter></BrowserRouter>
        <Routes>
          <Route path='/home' element={<Home />}></Route>
        </Routes>


    </div>
  );
}

export default App;
